<!DOCTYPE html>
<html lang="pt-BR">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1">
  <title>OsSuporte - By Actoweb</title>
  <style>
    html, body {
      height: 100%;
      margin: 0;
      padding: 0;
      width: 100%;
      box-sizing: border-box;
    }
    body {
      min-height: 100vh;
      display: flex;
      flex-direction: column;
      justify-content: center;
      align-items: center;
      background: #f7f7f7;
    }
    .logo-container {
      display: flex;
      flex-direction: column;
      align-items: center;
    }
    .logo-container img {
      max-width: 100%;
      width: 400px;
      height: auto;
      max-height: 110px;
      display: block;
    }
    .by-text {
      margin-top: 18px;
      font-size: 1.1rem;
      color: #555;
      text-align: center;
      font-family: Arial, Helvetica, sans-serif;
      letter-spacing: 1px;
    }
  </style>
</head>
<body>
  <div class="logo-container">
    <img src="data:image/png;base64," alt="Logo osSuporte">
    <div class="by-text" style="margin-right:-25px;">By Actoweb <a href="https://github.com/robertrsc/ossuporte"><img src="assets/imgs/git48.png" style="width:24px;height:auto;display:inline;" /></a></div>
  </div>
</body>
</html>
